import React from 'react'
import { data } from '../data/data'
import { Link } from 'react-router-dom'

const Subcategory = () => {
  return (
    <div>
    {data.map((item) => {item.datas.map((a) => <p key={a.id}><Link to={"/pages/id/" + a.id}>{a.title}</Link></p>)})}
    </div>
  )
}

export default Subcategory
